import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import static org.mockito.Mockito.*;

class PriorityQueueTest {
    private PriorityQueue<Integer> queue;

    @BeforeEach
    void setUp() {
        queue = new PriorityQueue<>();
    }

    @Test
    void shouldInsertElementIntoPriorityQueue() {
        // Arrange
        Integer element = 10;
        when(queue.add(element)).thenReturn(true);

        // Act
        boolean result = queue.insertElement(element);

        // Assert
        verify(queue).add(element);
        assertTrue(result);
    }

    @Test
    void shouldExtractMinimumElementFromPriorityQueue() {
        // Arrange
        Integer element1 = 10;
        Integer element2 = 5;
        when(queue.isEmpty()).thenReturn(false);
        when(queue.size()).thenReturn(2);
        when(queue.get(0)).thenReturn(element1);
        when(queue.remove(0)).thenReturn(element2);

        // Act
        Integer result = queue.extractMinimumElement();

        // Assert
        verify(queue).isEmpty();
        verify(queue).size();
        verify(queue).get(0);
        verify(queue).remove(0);
        assertEquals(element2, result);
    }
}
